comment:
베댓들 민폐민폐 하는데..
이거 설정자체가 그런만화잖아; 
현실이랑 상관도 없다구;
걍 보고 귀엽네하고 넘어가는만화설정에
뭐이리 진지하나..

아 물타기 작작해 이사람들아...  글작가 욕하고 그림작가 칭찬만 하고있으면 글작가님이 힘 많이 나서 더 좋은 글써야지!하고 결심하시겠냐? 진짜 6회까지 나왔고 일상 힐링 스토리같은데 맨날천날 스토리별로다 주인공별로다 그림체는 취저인데 스토리는 별로다 이소리만 쳐해대고있어요 ;;
별로면 보지마 싫은거 쳐보면서 악플쳐다는거 보니까 시간만 풍족한 할짓없는 인생이구나 참...ㅜ
글작가님 힘내세요 저런댓글들 다 물타기니까 갈수록 줄어들거에요 화이팅! 그림작가님도 넘 예뻐요 화이팅! 둘다 좋음 굳굳

몇화째 오버워치 얘기만 합니까;;
게임 안 하는 사람은 이해도 안 가고 스토리도 게임하는게 끝이고..
작화는 인정하는데 내용이 너무 별로네요

체육때 조짜는게 뭐 어때서 체육쌤이 조짜주면 오히려 어색한 애들끼리 만났을때 제대로 진행도 안되서 체육시간 개노잼되는데 반애 친구가 아예없으면 모를까
다들 친구 1명쯤은 있자나 친구가 없는애들은 자기 행동이나 성격에 문제가 있다고 생각하고 고쳐야 되는데 안고치니깐 왕따가 생기는거임 애초에 학교에서 나대고 찐따처럼 안있으면 애들이 같이 놀자고 그러는데 우리반에도 찐따가 2명있는데 얘네들은 그냥 행동이 나 찐따에요! 하면서 다님 그걸 말해줘도 무시까고 안고쳐서
이젠 아예 형들한테 찍혔는데 이렇듯이 학교에서 안나대고 찐따같이 안있으면 괜찮은데 꼭 지랄맞은 행동을 하니깐 왕따가 되는거야;;
